import React from 'react';
import UsersView from './UserView';
import { Backdrop, ModalWindow, ReturnBtn } from './styles';

const UserList = ({ allUsers = [], handleUserSelection }) =>
  console.log(allUsers) || (
    <Backdrop>
      <ModalWindow>
        <ReturnBtn>Go Back</ReturnBtn>

        <ul>
          {allUsers.map(user => (
            <li key={user.name}>
              <UsersView key={user.id} user={user} onClick={() => handleUserSelection(user.name)} />
            </li>
          ))}
        </ul>
      </ModalWindow>
    </Backdrop>
  );

export default UserList;
